import {
  Canvas,
} from '@react-three/fiber'
import {
  Fab,
  Grid,
} from '@mui/material';
import EditIcon from '@mui/icons-material/Edit';
import InfoOutlinedIcon from '@mui/icons-material/InfoOutlined';

function App() {
  return (
    <>
      <Grid container>
        <Grid container item justifyContent="right">
          <Fab
            aria-label='info'
            color="secondary"
          >
            <InfoOutlinedIcon />
          </Fab>
        </Grid>
        <Grid container item>
        <Canvas />
        </Grid>
      </Grid>
    </>
  );
}

export default App;
